import './App.css';
import {
    LineChart,
    ResponsiveContainer,
    Legend, Tooltip,
    Line,
    XAxis,
    YAxis,
    CartesianGrid
} from 'recharts';
import { Component } from 'react';

// Sample chart data
const pdata = [
    {
        name: 'MongoDb',
        student: 11,
        fees: 120
    },
    {
        name: 'Javascript',
        student: 15,
        fees: 12
    },
    {
        name: 'PHP',
        student: 5,
        fees: 10
    },
    {
        name: 'Java',
        student: 10,
        fees: 5
    },
    {
        name: 'C#',
        student: 9,
        fees: 4
    },
    {
        name: 'C++',
        student: 10,
        fees: 8
    },
];

class lineChart extends Component {
    constructor(props) {
        super(props);

    }

    render() {
        
        const min = Math.round(Math.min(...pdata.map(o => o.premium)) - 5)
        const max = Math.round(Math.max(...pdata.map(o => o.premium)) + 5)
        
        return (
            <div>
                <div class="row no-gutters">
                    <div class="col-md-6 no-gutters" style={{ align: "left" }}>

                        <h3 className="text-center" style={{ marginTop: "5px" }}>
                            Nifty ATM
                        </h3>
                        <div className='leftside'>
                            <ResponsiveContainer height='80%' width='100%'>
                                <LineChart data={this.props.data}>
                                    <CartesianGrid />
                                    <XAxis dataKey="time" angle={-45}
                                        interval={15} />
                                    <YAxis interval={2} tickCount={20} type="number" domain={[min, max]}></YAxis>
                                    <Legend />
                                    <Tooltip />
                                    <Line dataKey="premium" type='monotone' interval={10}
                                        stroke="blue" strokeWidth={2} activeDot={{ r: 8 }} dot={false} />
                                </LineChart>
                            </ResponsiveContainer>
                        </div>
                    </div>
                    <div class="col-md-6 no-gutters">

                        <h3 className="text-center" style={{ marginTop: "5px" }}>
                            BankNifty ATM
                        </h3>
                        <div className='rightside'>
                            <ResponsiveContainer height='80%' width='100%'>
                                <LineChart data={this.props.data}  >
                                    <CartesianGrid />
                                    <XAxis dataKey="time" angle={-45}
                                        interval={15} />
                                    <YAxis interval={2} tickCount={20} type="number" domain={[min, max]}></YAxis>
                                    <Legend />
                                    <Tooltip />
                                    <Line dataKey="premium" type='monotone' interval={10}
                                        stroke="blue" strokeWidth={2} activeDot={{ r: 8 }} dot={false} />
                                </LineChart>
                            </ResponsiveContainer>
                        </div>

                    </div>

                </div>
            </div>
        );
    }
}

export default lineChart;
